import React from "react";

import styled from "styled-components";

const VectorIcon = styled.img`
  position: relative;
  width: 36px;
  height: 36px;
`;
const SearchForWallpapr = styled.div`
  position: relative;
  font-size: var(--font-size-sm);
  font-family: var(--font-inter);
  color: rgba(255, 255, 255, 0.72);
  text-align: center;
`;
const Property1default = styled.button`
  cursor: pointer;
  border: none;
  padding: var(--padding-3xs) var(--padding-base);
  background-color: #da00d1;
  position: absolute;
  top: 20px;
  left: 20px;
  border-radius: var(--br-81xl);
  width: 993px;
  overflow: hidden;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: flex-start;
  box-sizing: border-box;
  gap: var(--gap-3xs);
`;
const Div = styled.div`
  position: relative;
  font-size: var(--font-size-sm);
  font-family: var(--font-inter);
  color: rgba(0, 0, 0, 0.72);
  text-align: center;
`;
const Property1variant2 = styled.button`
  cursor: pointer;
  border: none;
  padding: var(--padding-3xs) var(--padding-base);
  background-color: #fff;
  position: absolute;
  top: 96px;
  left: 20px;
  border-radius: var(--br-81xl);
  width: 993px;
  overflow: hidden;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: flex-start;
  box-sizing: border-box;
  gap: var(--gap-3xs);
`;
const Property1defaultParentRoot = styled.div`
  position: relative;
  border-radius: 5px;
  border: 1px dashed #9747ff;
  box-sizing: border-box;
  width: 100%;
  height: 172px;
  overflow: hidden;
`;

const FrameComponentSet = () => {
  return (
    <Property1defaultParentRoot>
      <Property1default>
        <VectorIcon alt="" src="/vector.svg" />
        <SearchForWallpapr>Search For Wallpapr</SearchForWallpapr>
      </Property1default>
      <Property1variant2>
        <VectorIcon alt="" src="/vector1.svg" />
        <Div>|</Div>
      </Property1variant2>
    </Property1defaultParentRoot>
  );
};

export default FrameComponentSet;
